import React, {Component} from 'react'
import 'react-awesome-slider/dist/styles.css';

export default class carrousel extends Component{
    render(){
        return(
            <div>
                {SliderData.map((slide, index) =>{
                    return(
                        <img src={slide.image} alt="travel image"/>
                    )
                })}
            </div>
        )
    }
}

